const ListCountries = ({ countriesToShow, selectCountry }) => {

    return (
        <div>
            <ul>    
            {countriesToShow.map(
                country => {
                    return ( 
                        <div key = {country.id} > 
                            <br/> 
                        <form onSubmit={selectCountry}> 
                            <input value = {country.name} > </input> 
                            <button type="submit" >show</button>
                        </form>
                        </div>
                    )
                }
            )}
            </ul>
        </div>
    )
}

export default ListCountries
